          <a><img src={circle} className="nav-icon" alt="circle" /></a>
          <a><img src={circle} className="nav-icon" alt="circle" /></a>
        </div>
        <p id="p">hi</p>
      </div>

        <Home id="home-id"/>
        <Developer id="developer-id"/>    
        <Design id="design-id"/>
        <Sketches id="sketches-id"/>
        <Contact id="contact-id"/>
      </div>
    );
  }
}
